import requestAPI from "../../../util/baseUrlCustomer";

export function getRegions(filter) {
  return requestAPI({
    url: "/Region/GetRegions",
    method: "Get",
    params:filter
  });
}

export function getRegionUnSelectedBank(filter) {
  return requestAPI({
    url: "/Region/GetRegionUnSelectedBank",
    method: "Get",
    params:filter
  });
}
export function insertRegion(data) {
  return requestAPI({
    url: "/Region/InsertRegion",
    method: "Post",
    data,
  });
}
export function updateRegion(data) {
  return requestAPI({
    url: "/Region/UpdateRegion",
    method: "Put",
    data,
  });
}

export function deleteRegion(region) {
  return requestAPI({
    url: "/Region/DeleteRegion",
    method: "Delete",
    params:region
  });
}
